import React from 'react';
import AddAddress from "./add_address";
import {connect} from "react-redux";
import {UpdateStatusFalse, UpdateStatusTrue} from "../../../../redux/addressReducer";

class AddAddressContainer extends React.Component{

render() {
return <AddAddress classes={this.props.classLabel} address={this.props.Address}/>
}
}
let mapStateToProps=(state)=>{
    return{
        status:state.statusInput,
        classLabel: state.classLabel,
        addressPage:state.Address
    }

}
const AddAddressContainerExport = connect(mapStateToProps,{UpdateStatusTrue,UpdateStatusFalse})(AddAddressContainer);
export default AddAddressContainerExport;
